import React from 'react'

function Footer() {
  return (
    <div className="lineBox">
      <div className="line"></div>
      // eslint-disable-next-line
      <div className="lineText"><a href="https://openweathermap.org/" target="_blank">openweathermap.org</a></div>
    </div>
  )
}

export default Footer
